import React from "react";
import Footer from "../../common/footer/Footer";
import Header from "../../common/header/Header";
import NotReady from "../notReady/NotReady";

function Propuestas () {
    return (
        <>
            <Header/>
            <NotReady/>
            <Footer/>
        </>
    )
}

export default Propuestas;
